import base64
data = ""
data = base64.b64decode(data)
import struct
from PIL import Image
SkinImageWidth =64
SkinImageHeight =64
pixel_list = []
for i in range(SkinImageWidth * SkinImageHeight):
    pixel = data[i * 4:(i + 1) * 4]
    try:
        r, g, b, a = struct.unpack('BBBB', pixel)
        pixel_list.append((r, g, b, a))
    except struct.error as ERR:
        print(ERR)
        break
image = Image.new('RGBA', (SkinImageWidth, SkinImageHeight))
image.putdata(pixel_list)
image.save('skin.png')
print(pixel_list)